import React from 'react'
import search from "../../Icons/search.png"

const Searcher = () => {
  return (
    <form className='searcher-nav'>
        <input type="submit"/>
        <input type="text"/>
        <input type="date"/>
        <input type="text"/>
    </form>
  )
}

export default Searcher
